def get_pLLR(mutant, logits):
    # mutation is str, example: 'A123L'
    # logits is a tensor of shape (seq_length, num_tokens)
    wt_token_idx = mutated_position_idx = tok_to_idx[mutant[0]]
    mut_token_idx = mutated_position_idx = tok_to_idx[mutant[-1]]

    mutated_position_idx = mutant[1:-1] - 1

    pLLR = np.log10(logits[mutated_position_idx, mut_token_idx] / logits[mutated_position_idx, wt_token_idx])

    return pLLR
